import pytest

import ioseeth.indicators.redpill as iir

# FIXTURES ####################################################################

@pytest.fixture
def redpill_contract_bytecode() -> tuple:
    return (
        '', # version 0.8.22
        '', # version 0.5.16
        '', # version 0.6.9
        '', # version 0.8.22
        '', # v 0.7.1
        '', # v 0.5.15
        '', # v0.5.15, optimized
        '', # v0.8.6 optimized
    )

# random bytecode + false positives from previous versions
@pytest.fixture
def random_contract_bytecode() -> tuple:
    return (
        '', # USDT
        '', # pseudo proxy
        '', # seaport
        '', # RewardOpenSlim
        '',
    )

# COINBASE TESTS ##############################################################

def test_indicators_detect_basic_test_on_coinbase(redpill_contract_bytecode):
    assert all([iir.bytecode_has_coinbase_test(bytecode=__b) for __b in redpill_contract_bytecode])

# DIFFICULTY TESTS ############################################################

def test_indicators_detect_basic_test_on_difficulty(redpill_contract_bytecode):
    assert all([iir.bytecode_has_difficulty_test(bytecode=__b) for __b in redpill_contract_bytecode])

# RANDOM ######################################################################

def  test_indicators_do_not_trigger_on_random_contracts(random_contract_bytecode):
    assert all([not iir.bytecode_has_coinbase_test(bytecode=__b) for __b in random_contract_bytecode])
    assert all([not iir.bytecode_has_difficulty_test(bytecode=__b) for __b in random_contract_bytecode])
